--
-- Create procedure `Proc_employee_GetPagging`
--
CREATE PROCEDURE Proc_employee_GetPagging (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(1000))
SQL SECURITY INVOKER
COMMENT '
  -- Author:        NDTRUNG
  -- Created date:  28/10/2022
  -- Description:   Lấy danh sách và phân trang
  -- Modified by:
  -- Code chạy thử:  CALL `misa.web10.nsdh.ndtrung`.Proc_employee_GetPagging(10,30,NULL,v_Where);'
BEGIN
  -- Sinh ra câu lệnh:
  -- Kiểm tra nếu tham số đầu vào v_Where bị NULL --> gán giá trị cho v_Where = ''
  -- --> Kiểm tra giá trị v_Where nếu = '' thì set v_Where = '1=1'
  -- SELECT * FROM employee WHERE 1=1;
  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  -- Kiểm tra nếu tham số đầu vào v_Sort bị NULL --> gán giá trị cho v_Sort = ''
  -- --> Kiểm tra giá trị v_Sort nếu = '' thì set v_Sort = 'ModifiedDate DESC'
  -- SELECT * FROM employee WHERE 1=1 ORDER BY ModifiedDate DESC;
  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  IF v_Limit = -1 THEN
    -- Lấy tất cả bản ghi trong DB thỏa mãn điều kiện Where, Sort
    SET @filterQuery = CONCAT('SELECT  e.EmployeeID, e.EmployeeCode, e.EmployeeName, e.DepartmentID, e.DateOfBirth, e.Gender, e.IdentityNumber, e.PostionName, e.BankAccountNumber, e.BankName,e.BankBranchName, d.DepartmentName, e.ModifiedDate, e.IdentityIssuedDate, e.IdentityIssuedPlace, e.Address, e.Email, e.TelephoneNumber, e.PhoneNumber
    FROM employee e
    INNER JOIN department d
    ON e.DepartmentID = d.DepartmentID
    WHERE ', v_Where, ' ORDER BY ', v_Sort);
  ELSE
    SET @filterQuery = CONCAT('SELECT  e.EmployeeID, e.EmployeeCode, e.EmployeeName, e.DepartmentID, e.DateOfBirth, e.Gender, e.IdentityNumber, e.PostionName, e.BankAccountNumber, e.BankName,e.BankBranchName, d.DepartmentName, e.ModifiedDate, e.IdentityIssuedDate, e.IdentityIssuedPlace, e.Address, e.Email, e.TelephoneNumber, e.PhoneNumber
    FROM employee e
    INNER JOIN department d
    ON e.DepartmentID = d.DepartmentID
    WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit);
  END IF;
  -- Limit: Số bản ghi trên 1 trang, Offset: Thứ tự của bản ghi bắt đầu lấy

  -- filterQuery và @filterQuery có ý nghĩa khác nhau
  -- filterQuery là 1 statement
  -- @filterQuery là 1 biến có kiểu dữ liệu là string

  -- Thực hiện câu lệnh:
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  -- Lấy ra tổng số bản ghi thỏa mãn điều kiện lọc
  SET @filterQuery = CONCAT('SELECT count(EmployeeID) AS TotalCount FROM employee WHERE ', v_Where);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

